INSERT INTO `xhs_news` VALUES ('11', '标题', '副标题', 'image/2ef311f41bd5ad6e4699495f88cb39dbb7fd3c0f.jpg', '<p><br/></p><p><img src=\"/uploads/ueditor/php/upload/image/20170721/1500617075417110.jpeg\" title=\"1500617075417110.jpeg\" alt=\"95d57d1ed21b0ef49a00b4fbd7c451da80cb3e45.jpg\"/></p><p>我（张小姐）在两年前与前男友分手。彼此都曾说过“分手后还是朋友，偶尔也要保持联络喔”，但是最后仍是日渐疏远。刚分手时，我们还因为出国旅游等问题时常联系，但是各自定下来后，不知不觉间便不再来往，就这样一年过去了。期间我也十分积极地想寻觅新恋情，当然也就不曾想过要挽回爱情。</p><p>就在这时，我忽然想起他的生日快到了，于是传了封简讯给他。对方也态度自然地寄来回复说：“我很好！谢谢你！”这次之后，我们开始会传简讯给对方,慢慢的我想起他对我的好。</p><p>我对于前男友的爱意顿时一口气攀升，从“复合好像也不错喔”，转变成“我想复合！”但是前男友已有了目标追求的对象，我也没有勇气再往前跨出一步。</p><p>案例分析：因为先前还未有想要复合的强烈意愿时，张小姐能够毫无芥蒂地与旧情人相处，但是一旦意识到复合这个想望，她的态度肯定会变得很不自然。希望对方为自己做些什么的欲望也会跟着增长。很可能因为这些不安而破坏他们好不容易构筑起来的友好关系。</p><p>于是我们导师告诉张小姐要理智地分析对方的心境和态度，慢慢地进行互动，每一条短信和电话都经过精心的编辑，让前男友毫无芥蒂地与她进行交流，进一步完成二次吸引。</p><p>导师同时讲到，为了从老朋友此一关系中跳脱并往前迈进，就需要一样能够牵动他思绪的东西。只要令他觉得“你变的更有魅力了呢”，他肯定就会对你涌起莫大的兴趣。另外，比起谈论过去，不如多聊聊将来，在未来这个蓝图当中找出许多你们的共通点，而从形成共鸣。</p><p>留意到这几点之后，张小姐很快地开始与前男友谈论现在的自己和以前有哪里不一样，也会略微提及未来的事情，并对他的意见表示赞同“对对！我明白那种感觉喔！”</p><p>就这样，她一点一点地引起了他的兴趣。约莫过了半年，他终于答应了张小姐的邀约。分手三年后，他们最终复合了。</p><p><br/></p>', '6', '2017-07-21 14:04:56', '2017-07-21 14:25:08', '作者', '1');
