INSERT INTO `xhs_news` VALUES ('18', '情感医院帮助我让老公不再逃避问题，自愿与小三分开', '在外遇这件事情上，我和老公僵持一个多月了，我真的不知道该怎么办，是等他玩醒了回头，还是等时机成熟了带儿子离开？这两种结果都让我倍受煎熬。我现在发现我陷', 'image/imgx1.png', '<p><br/></p><p style=\"text-align: left;\"><img src=\"http://qinggan.baihe.com/images/cgjsp.jpg\" width=\"634\" height=\"281\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em; text-align: left;\">在外遇这件事情上，我和老公僵持一个多月了，我真的不知道该怎么办，是等他玩醒了回头，还是等时机成熟了带儿子离开？这两种结果都让我倍受煎熬。我现在发现我陷入了死胡同，我越想解决这个问题，对我的伤害越深。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em; text-align: left;\">而我遇到的对手又是一个有过创伤的人，她不认为自己有什么过错。而老公的态度是坚持两个女人都要，两个都不想舍，我受不了，想离开他，可离婚，他舍不得平分家产；不离婚，他又不约束自己的行为，口口声声说离不开那个女孩的肉体，他要求我和平共处，睁只眼闭只眼，不再为钱发愁。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em; text-align: left;\">后来我重新把公司接手，他起初承诺说帮助我做业务。其实他一直在玩，一直到现在，这期间我多次提过离婚，但是更多的是劝说。他说他玩一段时间就会回来，他两个都不想舍， 我真的不知道该怎么办？</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em; text-align: left;\">案例分析</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em; text-align: left;\">在服务老师的指导下，客户在这次婚姻中成长了、独立了，重新整合了自己的家庭、婚姻、情感与个人追求，也知道该怎么面对自己的婚姻。在互动中奇迹发生了，以前从未觉得自己的出轨行为会给自己老婆形成过伤害的老公，竟能主动回头，在妻子面前忏悔，请求妻子原谅自己，愿意跟第三者断绝一切往来，以前从未觉得自己有任何问题的老公，现在竟能主动要求妻子带他去接受专业帮助。</p><p><br/></p>', '7', '2017-07-22 01:36:08', '2017-07-22 18:51:35', null, '1');
INSERT INTO `xhs_news` VALUES ('19', '男友和闺蜜有染，让我痛不欲生', '有句玩笑话叫“防火防盗防闺蜜”，虽然是戏言，但却真实悲剧的发生了在我（徐小姐）身上。前段时间，我发现男友和闺蜜之间.', 'image/imgx2.png', '<p><br/></p><p style=\"text-align: left;\"><img src=\"http://qinggan.baihe.com/images/cgjsp.jpg\" width=\"858\" height=\"281\" title=\"\" alt=\"\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em; text-align: left;\">有句玩笑话叫“防火防盗防闺蜜”，虽然是戏言，但却真实悲剧的发生了在我（徐小姐）身上。前段时间，我发现男友和闺蜜之间仿佛有点不一样的暧昧了，都说女人的第六感比雷达还准，这还真没有夸张。最初，我只是发现男友对闺蜜突然变得关注了，每次我说去干了什么事情，去到哪里玩的时候，男友总是会问闺蜜去了没有，还老爱打听她的事。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em; text-align: left;\">　　我开始感觉有点不同寻常了，尝试着试探了一下我闺蜜，发现她对我男友还挺欣赏的。有一次我们去吃饭，他居然知道闺蜜最喜欢吃的菜是什么，还帮她点了，他可是我们交往了很久之后才知道我最爱吃的菜是什么，当时我就发起了脾气，当面质问他们了，结果导致当时就闹的大家不欢而散了。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em; text-align: left;\">　　回去之后，男友嫌我在外面丢了他的面子，疑神疑鬼，就这样我们两人陷入了冷战。后来他就跟我说先分开一段时间，搬出去住了，闺蜜也向我解释说他们之间没有任何关系，并且开始疏远我了。说实话，我当时真的很爱我的男友的，希望可以跟他好好的走下去，没想到事情闹成这样。那段日子，我尝试着做各种的努力想要挽回男友的心，但是打电话他不接，发了无数条的短信之后，他只会偶尔回一条。慢慢的，我变得越来越绝望了。一次很偶然的机会，我在网上看到了百合情感救助平台，了解到他们百合网的情感救助团队。我决定寻求他们的帮助，为我和男友的感情做一次努力尝试。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em; text-align: left;\">案例分析：</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em; text-align: left;\">在百合情感专家的分析下，徐小姐意识到了自身存在的问题，在不确定男友和闺蜜是否有染的情况下，过激的言行和无端的猜疑只会让她和男友渐行渐远，导致两人之间的关系破裂。按照专家指导建议，徐小姐一步步努力提升自己，改善自己的心态，以全新的面貌跟男友进行沟通。专家不但手把手教她如何给男友发短信打电话，甚至还帮助她再次约出了男友。经过了两个多月的努力，男友最终还是回到了她的身边。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; text-indent: 2em; text-align: left;\">　　其实在两个人的相处中，总会遇到各种各样的诱惑和困难，放弃与离开并不是最好的解决方式，如何智慧的走下去才是最应该去思考的。相信，以后的路，他们二人会越走越好。</p><p><br/></p>', '7', '2017-07-22 01:39:54', '2017-07-22 18:36:57', null, '1');
